import { AppBar, Toolbar } from "@material-ui/core";

class Header extends Component {
    render() {
        return (
            <header>
                <AppBar>
                    <Toolbar>
                        EKDB STUDIO
                    </Toolbar>
                </AppBar>
            </header>
        );
    }
}

export default Header;
